--
-- Name: associates; Type: VIEW; Schema: public; Owner: cadurosar
--

CREATE VIEW associates AS
 SELECT pu.person_id,
    pu.cpf,
    pu.login,
    pu.occupation
   FROM (person_user pu
     JOIN donation d ON ((d.person_id = pu.person_id)))
  WHERE (((d.donation_type = 2) AND (date_part('year'::text, d.date_created) = date_part('year'::text, now()))) AND (d.donation_status = 2))
UNION
 SELECT pu.person_id,
    pu.cpf,
    pu.login,
    pu.occupation
   FROM (person_user pu
     JOIN benemerits b ON ((b.person_id = pu.person_id)))
  WHERE (b.date_finished IS NULL);


