--
-- Name: v_colonists_waiting_payment; Type: VIEW; Schema: public; Owner: cadurosar
--

CREATE VIEW v_colonists_waiting_payment AS
 SELECT scs.summer_camp_id,
    scs.colonist_id,
    scs.person_user_id,
    pr.fullname AS responsible_name,
    p.fullname AS colonist_name,
    s.description,
    scs.queue_number,
    scs.situation,
    p.gender
   FROM ((((summer_camp_subscription scs
     JOIN summer_camp_subscription_status s ON ((s.status = scs.situation)))
     JOIN colonist c ON ((c.colonist_id = scs.colonist_id)))
     JOIN person p ON ((p.person_id = c.person_id)))
     JOIN person pr ON ((pr.person_id = scs.person_user_id)))
  WHERE (scs.situation = 4);


ALTER TABLE public.v_colonists_waiting_payment OWNER TO cadurosar;

--
-- Name: v_colonists_with_queue_number; Type: VIEW; Schema: public; Owner: cadurosar
--

CREATE OR REPLACE VIEW v_colonists_with_queue_number as (
	select scs.summer_camp_id, scs.colonist_id, scs.person_user_id,
	pr.fullname as responsible_name, p.fullname as colonist_name, situation,
	description, queue_number, p.person_id AS colonist_person_id, pr.gender
	from summer_camp_subscription scs
	inner join summer_camp_subscription_status s on s.status = scs.situation
	inner join colonist c on c.colonist_id = scs.colonist_id
	inner join person p on p.person_id = c.person_id
	inner join person pr on pr.person_id = scs.person_user_id
	where queue_number is not null
	order by queue_number
);


ALTER TABLE public.v_colonists_with_queue_number OWNER TO cadurosar;

--
-- Name: v_colonists_with_responsables_not_parents; Type: VIEW; Schema: public; Owner: cadurosar
--

CREATE VIEW v_colonists_with_responsables_not_parents AS
 SELECT p.fullname AS colonist,
    p1.fullname AS responsable,
    date_part('YEAR'::text, sc.date_start) AS ano,
    c.person_id AS colonist_id,
    scs.person_user_id AS responsable_id,
    sc.camp_name,
    sc.summer_camp_id AS camp_id
   FROM ((((colonist c
     JOIN summer_camp_subscription scs ON ((c.colonist_id = scs.colonist_id)))
     JOIN summer_camp sc ON ((sc.summer_camp_id = scs.summer_camp_id)))
     JOIN person p ON ((p.person_id = c.person_id)))
     JOIN person p1 ON ((p1.person_id = scs.person_user_id)))
  WHERE (NOT (c.colonist_id IN ( SELECT parent_summer_camp_subscription.colonist_id
           FROM parent_summer_camp_subscription)));


ALTER TABLE public.v_colonists_with_responsables_not_parents OWNER TO cadurosar;

--
-- Name: v_discount; Type: VIEW; Schema: public; Owner: cadurosar
--

CREATE VIEW v_discount AS
 SELECT c.colonist_id,
    p.fullname AS colonist_name,
    pr.person_id AS responsable_id,
    pr.fullname AS responsable_name,
    scs.summer_camp_id AS camp_id,
    scs.discount,
    dr.discount_reason,
    scs.situation,
    scss.description AS situation_description,
    date_part('YEAR'::text, sc.date_start) AS year
   FROM ((((((colonist c
     JOIN person p ON ((p.person_id = c.person_id)))
     JOIN summer_camp_subscription scs ON ((scs.colonist_id = c.colonist_id)))
     JOIN person pr ON ((pr.person_id = scs.person_user_id)))
     JOIN discount_reason dr ON ((dr.discount_reason_id = scs.discount_reason_id)))
     JOIN summer_camp_subscription_status scss ON ((scss.status = scs.situation)))
     JOIN summer_camp sc ON ((sc.summer_camp_id = scs.summer_camp_id)));


ALTER TABLE public.v_discount OWNER TO cadurosar;

--
-- Name: v_report_all_users_association_detailed; Type: VIEW; Schema: public; Owner: cadurosar
--

CREATE VIEW v_report_all_users_association_detailed AS
 SELECT a.fullname,
    a.email,
    a.associate,
    a.person_id
   FROM ( SELECT p.fullname,
            p.email,
            'não sócio'::text AS associate,
            p.person_id
           FROM (person_user pu
             JOIN person p ON ((pu.person_id = p.person_id)))
          WHERE (NOT (pu.person_id IN ( SELECT associates.person_id
                   FROM associates)))
        UNION
         SELECT p.fullname,
            p.email,
            'contribuinte'::text AS associate,
            p.person_id
           FROM (associates a_1
             JOIN person p ON ((p.person_id = a_1.person_id)))
          WHERE (NOT (a_1.person_id IN ( SELECT p_1.person_id
                   FROM (benemerits b
                     JOIN person p_1 ON ((p_1.person_id = b.person_id)))
                  WHERE (b.date_finished IS NULL))))
        UNION
         SELECT p.fullname,
            p.email,
            'benemerito'::text AS associate,
            p.person_id
           FROM (benemerits b
             JOIN person p ON ((p.person_id = b.person_id)))
          WHERE (b.date_finished IS NULL)) a
  ORDER BY a.fullname;


ALTER TABLE public.v_report_all_users_association_detailed OWNER TO cadurosar;

--
-- Name: v_rel_associated_campaign; Type: VIEW; Schema: public; Owner: cadurosar
--

CREATE VIEW v_rel_associated_campaign AS
 SELECT vall.fullname,
    vall.email,
    vall.associate,
    vall.person_id,
        CASE
            WHEN (vall.associate = 'contribuinte'::text) THEN ( SELECT donation.date_created
               FROM donation
              WHERE (((donation.person_id = vall.person_id) AND (donation.donation_status = 2)) AND (donation.donation_type = 2)))
            WHEN (vall.associate = 'benemerito'::text) THEN ( SELECT benemerits.date_started
               FROM benemerits
              WHERE ((benemerits.person_id = vall.person_id) AND (benemerits.date_finished IS NULL)))
            ELSE NULL::timestamp without time zone
        END AS data_associacao
   FROM v_report_all_users_association_detailed vall
  WHERE (vall.associate = 'contribuinte'::text);


ALTER TABLE public.v_rel_associated_campaign OWNER TO cadurosar;

--
-- Name: v_report_all_users; Type: VIEW; Schema: public; Owner: cadurosar
--

CREATE VIEW v_report_all_users AS
 SELECT p.fullname,
    p.email,
    COALESCE(( SELECT true AS bool
           FROM associates
          WHERE (associates.person_id = p.person_id)), false) AS associate,
    p.person_id
   FROM (person p
     JOIN person_user pu ON ((p.person_id = pu.person_id)));


ALTER TABLE public.v_report_all_users OWNER TO cadurosar;

--
-- Name: v_report_free_donations; Type: VIEW; Schema: public; Owner: cadurosar
