--
-- Name: v_subscriptions_not_submitted; Type: VIEW; Schema: public; Owner: cadurosar
--

CREATE VIEW v_subscriptions_not_submitted AS
 SELECT c.colonist_id,
    p.fullname AS colonist_name,
    p1.person_id AS responsable_id,
    p1.fullname AS responsable_name,
    scs.situation,
    scss.description AS situation_description,
    sc.summer_camp_id AS camp_id,
    sc.camp_name,
    date_part('YEAR'::text, sc.date_start) AS year
   FROM (((((person p
     JOIN colonist c ON ((c.person_id = p.person_id)))
     JOIN summer_camp_subscription scs ON ((c.colonist_id = scs.colonist_id)))
     JOIN summer_camp sc ON ((sc.summer_camp_id = scs.summer_camp_id)))
     JOIN person p1 ON ((p1.person_id = scs.person_user_id)))
     JOIN summer_camp_subscription_status scss ON ((scss.status = scs.situation)))
  WHERE ((((((scs.situation = ANY (ARRAY[0, 6])) AND (c.colonist_id IN ( SELECT medical_file.colonist_id
           FROM medical_file))) AND (c.colonist_id IN ( SELECT summer_camp_subscription.colonist_id
           FROM summer_camp_subscription
          WHERE (summer_camp_subscription.accepted_travel_terms = true)))) AND (c.colonist_id IN ( SELECT document.colonist_id
           FROM document
          WHERE (document.document_type = 3)))) AND (c.colonist_id IN ( SELECT summer_camp_subscription.colonist_id
           FROM summer_camp_subscription
          WHERE (summer_camp_subscription.accepted_terms = true)))) AND (c.colonist_id IN ( SELECT document.colonist_id
           FROM document
          WHERE (document.document_type = 5))));


ALTER TABLE public.v_subscriptions_not_submitted OWNER TO cadurosar;

--
-- Name: v_users_permissions; Type: VIEW; Schema: public; Owner: cadurosar
--

CREATE VIEW v_users_permissions AS
 SELECT DISTINCT p.person_id,
    p.fullname,
    COALESCE(( SELECT 1
           FROM person_user_type
          WHERE ((person_user_type.person_id = p.person_id) AND (person_user_type.user_type = 1))), 0) AS common_user,
    COALESCE(( SELECT 1
           FROM person_user_type
          WHERE ((person_user_type.person_id = p.person_id) AND (person_user_type.user_type = 2))), 0) AS system_admin,
    COALESCE(( SELECT 1
           FROM person_user_type
          WHERE ((person_user_type.person_id = p.person_id) AND (person_user_type.user_type = 3))), 0) AS director,
    COALESCE(( SELECT 1
           FROM person_user_type
          WHERE ((person_user_type.person_id = p.person_id) AND (person_user_type.user_type = 4))), 0) AS secretary,
    COALESCE(( SELECT 1
           FROM person_user_type
          WHERE ((person_user_type.person_id = p.person_id) AND (person_user_type.user_type = 5))), 0) AS coordinator,
    COALESCE(( SELECT 1
           FROM person_user_type
          WHERE ((person_user_type.person_id = p.person_id) AND (person_user_type.user_type = 6))), 0) AS doctor,
    COALESCE(( SELECT 1
           FROM person_user_type
          WHERE ((person_user_type.person_id = p.person_id) AND (person_user_type.user_type = 7))), 0) AS monitor_instructor
   FROM (person_user_type put
     LEFT JOIN person p ON ((p.person_id = put.person_id)))
  ORDER BY p.fullname;


ALTER TABLE public.v_users_permissions OWNER TO cadurosar;

