--
-- Name: _RETURN; Type: RULE; Schema: public; Owner: cadurosar
--

CREATE RULE "_RETURN" AS
    ON SELECT TO v_socios_count_inscricoes DO INSTEAD  SELECT p.person_id,
    p.fullname,
    p.date_created,
    p.date_updated,
    p.gender,
    p.email,
    p.address_id,
    count(scs.colonist_id) AS total_inscritos
   FROM ((associates a
     JOIN person p ON ((p.person_id = a.person_id)))
     LEFT JOIN summer_camp_subscription scs ON (((scs.person_user_id = a.person_id) AND (scs.summer_camp_id IN ( SELECT summer_camp.summer_camp_id
           FROM summer_camp
          WHERE (to_char(summer_camp.date_created, 'YYYY'::text) = to_char(now(), 'YYYY'::text)))))))
  GROUP BY p.person_id;


